import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import "../css/chatting.css";
import { ChatBTN, HelpBTN } from "./Buttons";

export function Chatting() {
  return (
    <div>
      <Header />
      <div className="main-container-chat">
        <div className="chat-box">
          <div className="messages">임시 채팅 영역</div>
          <div className="input-container">
            <input type="text" placeholder="메시지를 입력하세요." className="chat-input" />
            <button className="send-button">전송</button>
          </div>
        </div>
      </div>
      <ChatBTN />
      <HelpBTN />
      <Footer />
    </div>
  );
}
